import React from "react";
import { BrowserRouter as Router, Route } from "react-router-dom";
import Dashboard from "./Components/Dashboard";
import Header from "./Components/Layout/Header";
import "./App.css";

function App() {
  return (
    <div className="App">
      <div>
        <Router>
          <Header></Header>
        </Router>
      </div>
      <div>
        <Dashboard></Dashboard>
      </div>
    </div>
  );
}

export default App;
